// File: client/src/components/supporters/forms/CreateSupporterForm.tsx
import React from 'react';

interface CreateSupporterFormProps {
  onSubmit: (data: any) => void;
  onCancel: () => void;
  editMode?: boolean;
  existingSupporter?: any;
}

const CreateSupporterForm: React.FC<CreateSupporterFormProps> = ({ 
  onSubmit, 
  onCancel, 
  editMode = false, 
  existingSupporter 
}) => {
  return (
    <div className="fixed inset-0 bg-gray-500 bg-opacity-75 flex items-center justify-center p-4 z-50">
      <div className="bg-white rounded-lg shadow-xl max-w-2xl w-full">
        <div className="p-6">
          <h2 className="text-lg font-semibold mb-4">
            {editMode ? 'Edit Supporter' : 'Create New Supporter'}
          </h2>
          <p>Enhanced supporter form - To be implemented</p>
          <div className="mt-4 flex justify-end space-x-3">
            <button onClick={onCancel} className="px-4 py-2 border rounded">Cancel</button>
            <button onClick={() => onSubmit({})} className="px-4 py-2 bg-blue-600 text-white rounded">
              {editMode ? 'Update' : 'Create'}
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreateSupporterForm;
